# Generic form of data sets
  
Routinely gathered in ecology/microbiology/genomics 

### Data tables

  - .important[Abundances]: read counts of species/transcripts `\(j\)` in sample `\(i\)`
  - .important[Covariates]: value of environmental variable `\(k\)` in sample `\(i\)`
  - .important[Offsets]: sampling effort for species/transcripts `\(j\)` in sample `\(i\)`

### Need frameworks to model _dependencies between counts_ 

  - understand **environmental effects** &lt;br/&gt;
      `\(\rightsquigarrow\)` explanatory models (multivariate regression, classification)
  - exhibit **patterns of diversity** &lt;br/&gt;
      `\(\rightsquigarrow\)` summarize the information (clustering, dimension reduction)
  - understand **between-species interactions** &lt;br /&gt;
      `\(\rightsquigarrow\)` 'network' inference (variable/covariance selection)
  - correct for technical and **confounding effects** &lt;br/&gt;
      `\(\rightsquigarrow\)` account for covariables and sampling effort

---

# Models for multivariate count data

## If we were in a Gaussian world...

The .important[general linear model] [MKB79] would be appropriate! For each sample `\(i = 1,\dots,n\)`, 

`$$\underbrace{\mathbf{Y}_i}_{\text{abundances}} =  \underbrace{\mathbf{x}_i^\top \boldsymbol\Theta}_{\text{covariates}} + \underbrace{\mathbf{o}_i}_{\text{sampling effort}} + \boldsymbol\varepsilon_i, \quad \boldsymbol\varepsilon_i \sim \mathcal{N}(\mathbf{0}_p, \underbrace{\boldsymbol\Sigma}_{\text{between-species dependencies}})$$`

null covariance `\(\Leftrightarrow\)` independence `\(\rightsquigarrow\)` uncorrelated species/transcripts do not interact

.content-box-red[This model gives birth to Principal Component Analysis,
 Discriminant Analysis, Gaussian Graphical Models, Gaussian Mixture models and many others `\(\dots\)`]


## With count data...

There is no generic model for multivariate counts
  - Data transformation (log, `\(\sqrt{}\)`) : quick and dirty
  - Non-Gaussian multivariate distributions [Ino+17]: do not scale to data dimension yet
  - .important[Latent variable models]: interaction occur in a latent (unobserved) layer

---

# The Poisson Lognormal model (PLN)

The PLN model [AH89] is a .important[multivariate generalized linear model], where 

- the counts `\(\mathbf{Y}_i\)` are the response variables
- the main effect is due to a linear combination of the covariates `\(\mathbf{x}_i\)`
- a vector of offsets `\(\mathbf{o}_i\)` can be specified for each sample.

.content-box-red[
$$
\mathbf{Y}_i | \mathbf{Z}_i \sim \mathcal{P}\left(\exp\{\mathbf{Z}_i\}\right), \qquad \mathbf{Z}_i \sim \mathcal{N}({\mathbf{o}_i + \mathbf{x}_i^\top\boldsymbol\Theta},\boldsymbol\Sigma), \\
$$
]
.pull-left[The unkwown parameters are 
- `\(\boldsymbol\Theta\)`, the regression parameters
- `\(\boldsymbol\Sigma\)`, the variance-covariance matrix
]

.pull-right[
Stacking all individuals together, 
  - `\(\mathbf{Y}\)` is the `\(n\times p\)` matrix of counts  
  - `\(\mathbf{X}\)` is the `\(n\times d\)` matrix of design
  - `\(\mathbf{O}\)` is the `\(n\times p\)` matrix of offsets
]

### Properties: .small[.important[over-dispersion, arbitrary-signed covariances]]

- mean: `\(\mathbb{E}(Y_{ij}) =  \exp \left( o_{ij} + \mathbf{x}_i^\top {\boldsymbol\Theta}_{\cdot j} + \sigma_{jj}/2\right) &gt;  0\)`
- variance: `\(\mathbb{V}(Y_{ij}) = \mathbb{E}(Y_{ij}) + \mathbb{E}(Y_{ij})^2 \left( e^{\sigma_{jj}} - 1 \right) &gt; \mathbb{E}(Y_{ij})\)`
- covariance: `\(\mathrm{Cov}(Y_{ij}, Y_{ik}) = \mathbb{E}(Y_{ij}) \mathbb{E}(Y_{ik}) \left( e^{\sigma_{jk}} - 1 \right).\)`


---

# Natural extensions

### Various tasks of multivariate analysis

  - .important[Dimension Reduction]: rank constraint matrix `\(\boldsymbol\Sigma\)`.
    
    `$$\mathbf{Z}_i \sim \mathcal{N}(\boldsymbol\mu, \boldsymbol\Sigma = \mathbf{B}\mathbf{B}^\top), \quad \mathbf{B} \in \mathcal{M}_{pk} \text{ with orthogonal columns}.$$`

  - .important[Classification]: maximize separation between groups with means 

  `$$\mathbf{Z}_i \sim \mathcal{N}({\boldsymbol\mu}_k \mathbf{1}_{\{i\in k\}}, \boldsymbol\Sigma), \quad \text{for known memberships}.$$`

  - .important[Clustering]: mixture model in the latent space 

  `$$\mathbf{Z}_i \mid i \in k  \sim \mathcal{N}(\boldsymbol\mu_k, \boldsymbol\Sigma_k), \quad \text{for unknown memberships}.$$`

  - .important[Network inference]: sparsity constraint on inverse covariance.
  
  `$$\mathbf{Z}_i \sim \mathcal{N}(\boldsymbol\mu, \boldsymbol\Sigma = \boldsymbol\Omega^{-1}), \quad \|\boldsymbol\Omega \|_1 &lt; c.$$`

  - .important[Variable selection]: sparsity constraint on regression coefficients
  
  `$$\mathbf{Z}_i \sim \mathcal{N}(\mathbf{x}_i^\top\boldsymbol\Theta, \boldsymbol\Sigma), \quad \|\boldsymbol\Theta \|_1 &lt; c.$$`



&lt;!-- VARIATIONAL INFERENCE --&gt;


---
# Inference: .small[latent model but intractable EM]
  
Estimate `\(\theta = (\boldsymbol\Theta, \boldsymbol\Sigma)\)`, predict the `\(\mathbf{Z}_i\)`, while  the model marginal likelihood is

`$$p_\theta(\mathbf{Y}_i) = \int_{\mathbb{R}_p} \prod_{j=1}^p p_\theta(Y_{ij} | Z_{ij}) \, p_\theta(\mathbf{Z}_i) \mathrm{d}\mathbf{Z}_i$$`

### Maximum likelihood for incomplete data model: EM

With `\(\mathcal{H}(p) = -\mathbb{E}_p(\log(p))\)` the entropy of `\(p\)`,

`$$\log p_\theta(\mathbf{Y}) = \mathbb{E}_{p_\theta(\mathbf{Z}\,|\,\mathbf{Y})} [\log p_\theta(\mathbf{Y}, \mathbf{Z})] + \mathcal{H}[p_\theta(\mathbf{Z}\,|\,\mathbf{Y})]$$` 

EM requires to evaluate (some moments of) `\(p_\theta(\mathbf{Z} \,|\,  \mathbf{Y})\)`, but there is no close form!

### Solutions

  - [AH89] resort on numerical integration; [Kar05] Monte-Carlo integration
  - Several heuristics, not always well motivated, found in the literature...
  - .important[Variational approach] [WJ08]: use a proxy of `\(p_\theta(\mathbf{Z}\,|\,\mathbf{Y})\)`.

---
# Variational approximation

## Principle

  - Find a proxy of the conditional distribution `\(p(\mathbf{Z}\,|\,\mathbf{Y})\)`:

`$$q(\mathbf{Z}) \approx p_\theta(\mathbf{Z} | \mathbf{Y}).$$`
  - Choose a convenient class of distribution `\(\mathcal{Q}\)` and minimize a divergence

`$$q(\mathbf{Z})^\star  \arg\min_{q\in\mathcal{Q}} D\left(q(\mathbf{Z}), p(\mathbf{Z} | \mathbf{Y})\right).$$`

## Popular choice

The Küllback-Leibler divergence .small[(error averaged wrt the approximated distribution)]

`$$KL\left(q(\mathbf{Z}), p(\mathbf{Z} | \mathbf{Y})\right) = \mathbb{E}_q\left[\log \frac{q(z)}{p(z)}\right] = \int_{\mathcal{Z}} q(z) \log \frac{q(z)}{p(z)} \mathrm{d}z.$$`

---
# Variational EM &amp; PLN

## Class of distribution: diagonal multivariate Gaussian

`$$\mathcal{Q} = \Big\{q: \quad q(\mathbf{Z}) = \prod_i q_i(\mathbf{Z}_i), \quad q_i(\mathbf{Z}_i) = \mathcal{N}\left(\mathbf{Z}_i; \mathbf{m}_i, \mathrm{diag}(\mathbf{s}_i \circ \mathbf{s}_i)\right), \mathbf{m}_i, \mathbf{s}_i\in\mathbb{R}_p \Big\}$$`

Maximize the ELBO (Evidence Lower BOund):

`$$J(\theta, q) = \log p_\theta(\mathbf{Y}) - KL[q_\theta (\mathbf{Z}) ||  p_\theta(\mathbf{Z} | \mathbf{Y})]  = \mathbb{E}_{q} [\log p_\theta(\mathbf{Y}, \mathbf{Z})] + \mathcal{H}[q(\mathbf{Z})]$$`

## Variational EM

  - VE step: find the optimal `\(q\)` (here, `\(\{(\mathbf{m}_i, \mathbf{s}_i)\}_{i=1,\dots,n} = \{\mathbf{M}, \mathbf{S}\}\)`): 
`$$q^h = \arg \max J(\theta^h, q) = \arg\min_{q \in \mathcal{Q}} KL[q(\mathbf{Z}) \,||\, p_{\theta^h}(\mathbf{Z}\,|\,\mathbf{Y})]$$`
  - M step: update `\(\hat{\theta}^h\)`
`$$\theta^h = \arg\max J(\theta, q^h) = \arg\max_{\theta} \mathbb{E}_{q} [\log p_{\theta}(\mathbf{Y}, \mathbf{Z})]$$`

---
# ELBO and gradients for PLN

Let `\(\mathbf{A} = \mathbb{E}_q[\exp(\mathbf{Z})] = \exp\left(\mathbf{O} + \mathbf{M} + \frac12 \mathbf{S}^2\right)\)`

### Variational bound

`$$\begin{array}{ll}
J(\mathbf{Y}) &amp; = \mathbf{1}_n^\intercal \left( \left[ \mathbf{Y} \circ (\mathbf{O} + \mathbf{M}) - \mathbf{A} + \log(\mathbf{S})\right]\right) \mathbf{1}_{p} + \frac{n}2\log|{\boldsymbol\Omega}| \\
&amp; - \frac12 \mathrm{trace}\left({\boldsymbol\Omega} \bigg[\left(\mathbf{M} - \mathbf{X}{\boldsymbol\Theta}\right)^\intercal \left(\mathbf{M} - \mathbf{X}{\boldsymbol\Theta}\right) + \mathrm{diag}(\mathbf{1}_n^\intercal\mathbf{S}^2)\bigg]\right) + \text{cst.}\\
\end{array}$$`

### M-step (Analytical)

`$$\hat{{\boldsymbol\Theta}} = \left(\mathbf{X}^\top \mathbf{X}\right)^{-1} \mathbf{X} \mathbf{M}, \quad 
   \hat{{\boldsymbol\Sigma}} = \frac{1}{n} \left(\mathbf{M}-\mathbf{X}\hat{{\boldsymbol\Theta}}\right)^\top \left(\mathbf{M}-\mathbf{X}\hat{\boldsymbol\Theta}\right) + \frac{1}{n} \mathrm{diag}(\mathbf{1}^\intercal\mathbf{S}^2)$$`

### Variational E-step (optimization)

`$$\frac{\partial J(q)}{\partial \mathbf{M}} =  \left(\mathbf{Y} - \mathbf{A} - (\mathbf{M} - \mathbf{X}{\boldsymbol\Theta}) \mathbf{\Omega}\right), \qquad \frac{\partial J(q)}{\partial \mathbf{S}} = \frac{1}{\mathbf{S}} - \mathbf{S} \circ \mathbf{A} - \mathbf{S} \mathrm{D}_{\boldsymbol\Omega} .$$`



---

# .small[Application to the optimization of PLN models]
  
## Property of PLN variational approximation

The ELBO `\(J(\theta, q)\)` is bi-concave, i.e.
  - concave wrt `\(q = (\mathbf{M}, \mathbf{S})\)` for given `\(\theta\)` 
  - convace wrt `\(\theta = (\boldsymbol\Sigma, \boldsymbol\Theta)\)` for given `\(q\)` 
but .important[not jointly concave] in general.

## Optimization

Gradient ascent for the set of variational parameters `\((\mathbf{M}, \mathbf{S})\)`

#### Medium scale problems

  - **algorithm**: conservative convex separable approximations Svanberg [Sva02] &lt;br/&gt;
  - **implementation**: `NLopt` nonlinear-optimization library Johnson [Joh11] &lt;br/&gt;
  - **initialization**: LM after log-transformation applied independently on each variables + concatenation of the regression coefficients + Pearson residuals

`\(\rightsquigarrow\)` Comfortable up to a thousand of sites ( `\(n \approx 1000\)` ), hundreds of species ( `\(p\approx 100s\)` )

# Oaks powdery mildew data set overview

Jakuschkin, Fievet, Schwaller, Fort, Robin, and Vacher [Jak+16] Study .important[effects of the pathogen] _E.Aphiltoïdes_ (mildew) wrt bacterial and microbial communities

## Species Abundances

- .important[Microbial communities] sampled on the surface of `\(n = 116\)` oak leaves
- Communities sequenced and cleaned resulting in `\(p=114\)` OTUs (66 bacteria, 48 fungi).

## Covariates and offsets

Characterize the samples and the sampling, most important being

- `tree`: Tree status with respect to the pathogen (susceptible, intermediate or resistant)
- `distTOground`: Distance of the sampled leaf to the base of the ground
- `orientation`: Orientation of the branch (South-West SW or North-East NE)
- `readsTOTfun`: Total number of ITS1 reads for that leaf
- `readsTOTbac`: Total number of 16S reads for that leaf

#  PLN with offsets and covariates (1)

## Offset: .small[modeling sampling effort]

The predefined offset uses the total sum of reads, accounting for technologies specific to fungi and bacteria:


```r
M01_oaks &lt;- PLN(Abundance ~ 1 + offset(log(Offset)) , oaks)
```

## Covariates: .small[tree and orientation effects ('ANOVA'-like) ]

The `tree` status is a natural candidate for explaining a part of the variance.

- We chose to describe the tree effect in the regression coefficient (mean)
- A possibly spurious effect regarding the interactions  between species (covariance).


```r
M11_oaks &lt;- PLN(Abundance ~ 0 + tree + offset(log(Offset)), oaks)
```

What about adding more covariates in the model, e.g. the orientation?


```r
M21_oaks &lt;- PLN(Abundance ~  0 + tree + orientation + offset(log(Offset)), oaks)
```

&lt;!-- ZI-PLN MODEL --&gt;


---

# A zero-inflated PLN .scriptsize[with M. Mariadassoua and F. Gindraud]

### Motivations 

- account for a large amount of zero, i.e. with single-cell data,
- try to separate "true" zeros from "technical"/dropouts

### The Model

Use two latent vectors `\(\mathbf{W}_i\)` and `\(\mathbf{Z}_i\)` to model excess of zeroes and dependence structure 
`$$\begin{aligned}
   \mathbf{Z}_i &amp; \sim \mathcal{N}({\mathbf{o}_i + \mathbf{x}_i^\top\boldsymbol\Theta},\boldsymbol\Sigma) \\
    W_{ij} &amp; \sim \mathcal{B}(\text{logit}^{-1}(\mathbf{x}_i^\top{\boldsymbol\Theta}_j^0)) \\
    Y_{ij} \, | \, W_{ij}, Z_{ij} &amp; \sim W_{ij}\delta_0 + (1-W_{ij}) \mathcal{P}\left(\exp\{Z_{ij}\}\right), \\
\end{aligned}$$`
  
The unkwown parameters are 
- `\(\boldsymbol\Theta\)`, the regression parameters (from the PLN component)
- `\(\boldsymbol\Theta^0\)`, the regression parameters (from the Bernoulli component)
- `\(\boldsymbol\Sigma\)`, the variance-covariance matrix

`\(\rightsquigarrow\)` ZI-PLN is a mixture of PLN and Bernoulli distribution with shared covariates.

---

# ZI-PLN identifiability

Consider the standard ZIPLN model (*i.e.* not the ZIPLN-regression model) with 1 sample: 

`$$\begin{aligned}
  {(W_j)}_{j=1 \dots p} &amp; \sim \mathcal{B}^{\otimes} ( \mathbf{\pi} ) = \mathcal{B}(\pi_1) \otimes \dots \mathcal{B}(\pi_p) \\
  {(Z_j)}_{j=1 \dots p} &amp; \sim \mathcal{N}_p(\mathbf{\mu}, \mathbf{\Sigma} ) \\
  Y_j | W_j, Z_j &amp; \sim (1-W_j) \mathcal{P}(e^{Z_j}) + W_j \delta_0 \\
\end{aligned}$$`

### Proposition

The standard ZIPLN model defined above with parameter `\(\mathbf{\theta} = (\mathbf{\pi}, \mathbf{\mu}, \mathbf{\Sigma})\)` and parameter space `\((0,1)^{p} \times \mathbb{R}^p \times \mathbb{S}_p^{++}\)` is identifiable. 

**Proof**. We used the moments of `\(\mathbf{Y}\)` to prove identifiability and rely on the following results for Gaussian and Poisson distributions:

  - If `\(U \sim \mathcal{N}(\mu, \sigma^2)\)`, then `\(\mathbb{E}[e^U] = \exp(\mu + \sigma^2/2)\)`
  - If `\(U \sim \mathcal{P}(\lambda)\)` then `\(\mathbb{E}[U] = \lambda \quad  \mathbb{E}[U^2] = \lambda (1 + \lambda) \quad \mathbb{E}[U^2] = \lambda (1 + 3\lambda + \lambda^2)\)`

Each coordinate of `\(\mathbf{\theta}\)` can be expressed as a simple functions of the (first three) moments of `\(p_{\mathbf{\theta}}\)` and thus `\(p_{\mathbf{\theta}} = p_{\mathbf{\theta}'} \Rightarrow \mathbf{\theta} = \mathbf{\theta}'\)`. 

---

# ZI-PLN Inference

Same routine...

### Variational approximation

`\begin{equation*}
p(\mathbf{Z}_i, \mathbf{W}_i  \mathbf{Y}_i) \approx q_{\psi}(\mathbf{Z}_i, \mathbf{W}_i) \approx q_{\psi_1}(\mathbf{Z}_i) q_{\psi_2}(\mathbf{W}_i)
\end{equation*}`

with

`\begin{equation*}
q_{\psi_1}(\mathbf{Z}_i) = \mathcal{N}(\mathbf{Z}_i; \mathbf{m}_{i}, \mathrm{diag}(\mathbf{s}_{i} \circ \mathbf{s}_{i})), \qquad q_{\psi_2}(\mathbf{W}_i) = \otimes_{j=1}^p \mathcal{B}(W_{ij}, \pi_{ij})
\end{equation*}`

### Variational lower bound

Let `\(\theta = (\mathbf{\Theta}, \mathbf{\Theta}^0, \mathbf{\Sigma})\)` and `\(\psi= (\mathbf{M}, \mathbf{S}, \mathbf{\Pi})\)`, then

`\begin{align*}
J(\theta, \psi) &amp; =  \log p_\theta(\mathbf{Y}) - KL(p_\theta(. | \mathbf{Y}) \| q_\psi(.) ) \\
&amp; = \mathbb{E}_{q_{\psi}} \log p_\theta(\mathbf{Z}, \mathbf{W}, \mathbf{Y}) - \mathbb{E}_{q_{\psi}} \log q_\psi(\mathbf{Z}, \mathbf{W}) \\
&amp; = \mathbb{E}_{q_{\psi}} \log p_\theta (\mathbf{Y} | \mathbf{Z}, \mathbf{W}) + \mathbb{E}_{q_{\psi_1}} \log p_\theta (\mathbf{Z}) + \mathbb{E}_{q_{\psi_2}} \log p_\theta (\mathbf{W}) \\
&amp;  \qquad - \mathbb{E}_{q_{\psi_1}} \log q_{\psi_{1}} (\mathbf{Z}) - \mathbb{E}_{q_{\psi_2}} \log q_{\psi_2} (\mathbf{W}) \\
\end{align*}`

**Property**: `\(J\)` is separately concave in `\(\theta\)`, `\(\psi_1\)` and `\(\psi_2\)`.

---

# Optimizaton

### A sparse criterion

Recall that `\(\theta = (\mathbf{\Theta}, \mathbf{\Theta}^0, \mathbf{\Omega} = \mathbf{\Sigma}^{-1})\)`. Sparsity allows to control the number of parameters: 

`\begin{equation*}
 \arg\min_{\theta, \psi} J(\theta, \psi)  + \lambda_1 \| \mathbb{\Theta}  \|_1 + \lambda_2 \|  \mathbb{\Omega}  \|_1 \color{#ddd}{ \left( + \lambda_1 \| \mathbb{\Theta}^0  \|_1 \right)}
\end{equation*}`

### Alternate optimization

  - (Stochastic) Gradient-descent on `\(\mathbf{\Theta}^0, \mathbf{M}, \mathbf{S}\)`
  - Closed-form for posterior probabilities `\(\mathbf{\Pi}\)`
  - Inverse covariance `\(\mathbf{\Omega}\)` 
    - if `\(\lambda_2=0\)`, `\(\hat{\mathbf{\Sigma}} = n^{-1} \left[ (\mathbf{M} - \mathbf{X\Theta})^\top(\mathbf{M} - \mathbf{X\Theta}) + \bar{\mathbf{S}}^2 \right]\)`
    - if `\(\lambda_2 &gt; 0\)`, `\(\ell_1\)` penalized MLE ( `\(\rightsquigarrow\)` Graphical-Lasso with `\(\hat{\mathbf{\Sigma}}\)` as input)
  - PLN regression coefficient `\(\mathbf{\Theta}\)` 
    - if `\(\lambda_1=0\)`, `\(\hat{\mathbf{\Theta}} = [\mathbf{X}^\top \mathbf{X}]^{-1} \mathbf{X}^\top \mathbf{M}\)`
    - if `\(\lambda_1 &gt; 0\)`, vectorize and solve a `\(\ell_1\)` penalized least-squared problem

**Initialize** `\(\Theta^0\)` with logistic regression on `\(\delta_0(\mathbf{Y})\)`, `\(\mathbf{\Theta}\)` with Poisson regression

# A quick example in genomics (1)

### scRNA data set 

The dataset `scRNA` contains the counts of the 500 most varying transcripts in the mixtures of 5 cell lines in human liver (obtained with standard 10x scRNAseq Chromium protocol).

We subsample 500 random cells and the keep the 200 most varying genes


```r
library(ZIPLN)
data(scRNA)
scRNA        &lt;- scRNA[sample.int(nrow(scRNA), 500), ]
scRNA$counts &lt;- scRNA$counts[, 1:200]
scRNA$counts %&gt;% as_tibble() %&gt;% rmarkdown::paged_table()
```

We adjust the standard PLN model and the ZI-PLN model with some sparsity on the precision matrix:


```r
system.time(myPLN &lt;- 
    PLN(counts ~ 1 + offset(log(total_counts)),
        data = scRNA, control = list(trace = 0)))

##   0.641   0.004   0.646
```


```r
system.time(myZIPLN &lt;- 
    ZIPLN(counts ~ 1 + offset(log(total_counts)), rho = .25,
          data = scRNA, control = list(trace = 0)))
```

```
##    user  system elapsed 
##  14.245   0.032   2.356
```

# Statistical Inference

.content-box-red[We only consider the standard PLN model.]

## A first try: Wald test

Test `\(\mathcal{H}_0: R \theta = r_0\)` with the statistic
$$ (R \hat{\theta} - r_0)^\top \left[n R\hat{\mathbb{V}}(\hat{\theta}) R^\top \right]^{-1} (R \hat{\theta} - r_0) \sim \chi_k^2 \quad \text{where} \quad k = \text{rank}(R).$$

The Fisher Information matrix

`$$I(\hat{\theta}) = -  \mathbb{E}_\theta \left[ \frac{\partial^2 \log \ell(\theta; x)}{\partial  \theta^2} \right]$$`

can be used as an approximation of `\(n\mathbb{V}(\hat{\theta})^{-1}\)`.

## Application

Derive confidences interval for the inverse covariance `\(\mathbf{\Omega}\)` and the regression parameters `\(\mathbf{\Theta}\)`.

---

# Variational Wald-test


## Variational Fisher Information


The Fisher information matrix is given by

`$$I(\theta) = \begin{pmatrix}
  \frac{1}{n}(\mathbf{I}_p \otimes 
\mathbf{X}^\top)\mathrm{diag}(\mathrm{vec}(\mathbf{A}))(\mathbf{I}_p \otimes \mathbf{X}) &amp; \mathbf{0} \\
  \mathbf{0} &amp; \frac12\mathbf{\Omega}^{-1} \otimes 
\mathbf{\Omega}^{-1} 
  \end{pmatrix}$$`

and can be inverted blockwise to estimate `\(\mathbb{V}(\hat{\theta})\)`.

## Wald test and coverage

- `\(\hat{\mathbb{V}}(\mathbf{\Theta}_{kj}) = [n (\mathbf{X}^\top \mathrm{diag}(\mathrm{vec}(\hat{A}_{.j})) \mathbf{X})^{-1}]_{kk}\)`
- `\(\hat{\mathbb{V}}(\Omega_{kl}) = 2\Omega_{kk}\Omega_{ll}\)`

The confidence intervals at level `\(\alpha\)` are given by 

- `\(B_{kj} =  \hat{B}_{kj} \pm \frac{q_{1 - \alpha/2}}{\sqrt{n}} \sqrt{\hat{\mathbb{V}}(\mathbf{\Theta}_{kj})}\)` 
- `\(\Omega_{kl} =  \hat{\Omega}_{kl} \pm \frac{q_{1 - \alpha/2}}{\sqrt{n}} \sqrt{\hat{\mathbb{V}}(\Omega_{kl})}\)`. 

---

# Asymptotic consistency (?)

Let `\(\hat{\boldsymbol{\psi}}_i = \hat{\boldsymbol{\psi}}_i(\theta, Y_i) = \arg \max_{\boldsymbol{\psi}} J_{Y_i}(\theta, \boldsymbol{\psi})\)` and consider the stochastic map `\(\bar{J}_n\)` defined by:

`$$\bar{J}_n \; : \quad \theta \mapsto \frac{1}{n}\sum_{i=1}^{n} J_{Y_i}(\theta, \hat{\boldsymbol{\psi}}_i) \stackrel{\Delta}{=} \frac{1}{n}\sum_{i=1}^{n} \bar{J}_{Y_i}(\theta)$$`

M-estimation suggests that `\(\hat{\theta} = \arg\max_{\theta} \bar{J}_{n}(\theta)\)` should converge to `\(\bar{\theta} = \arg\max_{\theta} \bar{J}(\theta)\)` where `\(\bar{J}(\theta) = \mathbb{E}_{\theta^\star}[\bar{J}_\mathbf{Y}(\theta)] =  \mathbb{E}_{\theta^\star}[J_\mathbf{Y}(\theta, \hat{\boldsymbol{\psi}}(\theta, \mathbf{Y}))]\)`. 

### Theorem [WM15]

Under regularity condtions ensuring that `\(\bar{J}_n\)` is smooth enough (and satisfied for example when `\(\theta\)` and `\(\boldsymbol{\psi}_i\)` are restricted to compact sets), we have indeed: 
$$
\hat{\theta} \xrightarrow[n \to +\infty]{a.e.} \bar{\theta}
$$

.important[Open question:] `\(\bar{\theta} = \theta^\star\)` ? No formal results as `\(J\)` is untractable but numerical evidence suggest so.

# Numerical study

- number of samples `\(n \in \{50, 100, 500, 1000, 10000\}\)`

# Asymptotic normality

### Theorem [WM15]

Under additional regularity condtions (still satisfied for example when `\(\theta\)` and `\(\boldsymbol{\psi}_i\)` are restricted to compact sets), we have indeed: 
$$
\sqrt{n}(\hat{\theta} - \bar{\theta})  \xrightarrow[]{d} \mathcal{N}(0, V(\bar{\theta}))
$$
where `\(V(\theta) = C(\theta)^{-1} D(\theta) C(\theta)^{-1}\)` for 
$$
`\begin{aligned}
 C(\theta) = \mathbb{E}[\nabla_{\theta\theta} \bar{J}_Y(\theta) ] \quad \mathrm{and} \quad 
 D(\theta) = \mathbb{E}\left[(\nabla_{\theta} \bar{J}_Y(\theta)) (\nabla_{\theta} \bar{J}_Y(\theta)^\intercal \right]
\end{aligned}`
$$

### Practical computations .small[chain rule]

$$
`\begin{aligned}
\nabla_{\theta\theta} \bar{J}_{Y}(\theta) = \left[\nabla_{\theta\theta} J_{Y} - \nabla_{\theta \psi} J_{Y} (\nabla_{\psi\psi} J_{Y})^{-1} \nabla_{\psi\theta} J_{Y}\right] (\theta, \hat{\psi}) \text{ and } \nabla_{\theta} \bar{J}_{Y}(\theta) = \nabla_{\theta} J_{Y}(\theta, \hat{\psi})
\end{aligned}`
$$

$$
`\begin{aligned}
 \hat{C}_n(\theta) &amp; = \frac{1}{n} \sum_{i=1}^n \left[ \nabla_{\theta\theta} J_{Y_i} - \nabla_{\theta\psi_i} J_{Y_i} (\nabla_{\psi_i\psi_i} J_{Y_i})^{-1} \nabla_{\theta\psi_i} J_{Y_i}^\intercal \right](\theta, \hat{\psi}_i) \\
 \hat{D}_n(\theta) &amp; = \frac{1}{n} \sum_{i=1}^n \left[ \nabla_{\theta} J_{Y_i} \nabla_{\theta} J_{Y_i}^\intercal \right](\theta, \hat{\psi}_i)
\end{aligned}`
$$

---
# Reasonably ugly formula
 
Additional efforts and computational tricks give:

$$
`\begin{aligned}
\hat{D}_n(\theta) = \frac{1}{n} \sum_{i=1}^n \left[ (\mathbf{Y}_i - \mathbf{A}_i)(\mathbf{Y}_i - \mathbf{A}_i)^\intercal \right] \otimes \mathbf{x}_i \mathbf{x}_i^\intercal \in \mathbb{R}^{dp \times dp}
\end{aligned}`
$$
and 

$$
`\begin{aligned}
\hat{C}_n(\theta) = - \frac{1}{n} \sum_{i=1}^n \left[ \mathbf{D}_i^{1/2} \mathbf{C}_i (\mathbf{C}_i^{-1} - \mathbf{B}_i) \mathbf{C}_i \mathbf{D}_i^{1/2} \right] \otimes \mathbf{x}_i \mathbf{x}_i^\intercal \in \mathbb{R}^{dp \times dp}
\end{aligned}`
$$
where `\(\mathbf{D}_i = \mathrm{diag}(\mathbf{A}_i)\)` and 

$$
`\begin{aligned}
\mathbf{C}_i = \mathrm{diag}\left( \frac{\mathbf{2}_p}{\mathbf{2}_p + \mathbf{s}_i^2\mathbf{A}_i}\right) \quad \text{and} \quad 
\mathbf{B}_i = \left[\mathbf{C}_i + \mathbf{D}_i^{-1/2} \boldsymbol{\Omega} \mathbf{D}_i^{-1/2} \right]^{-1} 
\end{aligned}`
$$

# Exact likelihood maximization  

With B. Batardière, J. Kwon

To compare and assess at least empirically the performance of the VE-M estimator

  - Use importance sampling to estimate the likelihood: 

 `$$p_{\theta}(Y_i) = \int \tilde p_{\theta}(Y_i|Z) p(Z)  \mathrm d Z = \int \tilde p_{\theta}(Z) \mathrm d Z \approx \frac 1 {n_s} \sum_{k=1}^{n_s} \frac {\tilde p_{\theta}(V_k)}{g(V_k)}, ~ ~ ~(V_{k})_{1 \leq k \leq n_s} \overset{iid}{\sim} g$$`
 
  - Estimate the gradients of the log-likelihood by plug-in: 

  `$$\nabla _{\theta} \log p_{\theta}(Y_i) \approx \nabla_{\theta} \log\left(\frac 1 {n_s} \sum_{k=1}^{n_s} \frac {\tilde p_{\theta}^{(u)}(V_k)}{g(V_k)}\right)$$`

  - Use SAGA (F. Bach), a smart incremental gradient descent approach 

`\(\rightsquigarrow\)` Work up to `\(n=1,000, p = 30\)`, `\(n=1,000, q = 30, p &gt;&gt; q\)` for PCA variant

# Conclusion

## Summary

  - PLN = generic model for multivariate count data analysis
  - Flexible modeling of the covariance structure, allows for covariates
  - Efficient V-EM algorithm

## Extensions

- Other variants
      - covariance structures (spatial, time series, genetics...)
- Other models
  - Bernoulli/multinomial counterpart to PLN
  - functional data
  - multiple-data integration (e.g., Bernoulli + Poisson)
